import React from "react";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Thumbnail from "./../../Thumbnail";


const WorkPage = () => {
    return (
        <Container>
           <h2> Work </h2> 
           <Row>
               <Col>
               <Thumbnail/>
               <Thumbnail/>
               </Col>
           </Row>
        </Container>



    )
}

export default WorkPage;
